import React from "react";
import { LocalGrid, Column1, Column2, Column3 } from "./sectionElements";

export const SingleSection = ({
  id,
  src,
  alt,
  header,
  subtitle,
  content,
  svgfirst,
}) => {
  return (
    <LocalGrid id={id}>
      <Column1>
        <ImageDiv>
          <Svg src={src} alt={alt}/>
        </ImageDiv>
      </Column1>
      <Column2>Header Here</Column2>
      <Column3>All the content</Column3>
    </LocalGrid>
  );
};
